import './App.css';
import Dashboard from './modules/Dashboard';
import Form from './modules/Form';
import { Routes, Route } from 'react-router-dom';
import ProtectedRoute from './ProtectedRoute'; // Import your ProtectedRoute component

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<ProtectedRoute auth={true}><Dashboard /></ProtectedRoute>} />
        <Route path="/users/sign_in" element={<ProtectedRoute><Form isSignInPage={true} /></ProtectedRoute>} />
        <Route path="/users/sign_up" element={<ProtectedRoute><Form isSignInPage={false} /></ProtectedRoute>} />
      </Routes>
    </div>
  );
}

export default App;
